import React from 'react';
import Layout from '../Layout/Layout';
import './project.css';
import Card from '../Ui Kits/Cart/Card';

function Project() {
  return (
    <div>
      <Layout>
        <div className='main_div'></div>
        <h1>Project Category</h1>
        <Card width='300px' height='500px' />
      </Layout>
    </div>
  );
}

export default Project;
